import React from 'react';

const UrlList = () => {
    return (
        <div>
            <h1>Url list</h1>
            <hr />
            <div className="container">
                <div>
                    <h3>google </h3>
                    <button className="url-btn"><a href="#">Munch.ly/Google.com</a></button>
                </div>
            </div>


        </div>
    );
};

export default UrlList;
